# https://github.com/kerrickstaley/genanki
import genanki
import re
import html

# Create a basic model for the cards
leetcode_model = genanki.Model(
    1607392319,  # Unique model ID
    'LeetCode Problem Link',
    fields=[
        {'name': 'Link'},  # Just one field for the link
        {'name': 'URL'},   # Add URL field
    ],
    templates=[
        {
            'name': 'Problem Card',
            'qfmt': '<a href="{{URL}}" style="text-decoration: none; color: #3498db; font-size: 20px;">{{Link}}</a>',  # Show as clickable link
            'afmt': '<a href="{{URL}}" style="text-decoration: none; color: #3498db; font-size: 20px;">{{Link}}</a>',  # Show same thing on back
        },
    ],
    css='.card { font-family: arial; text-align: center; } a:hover { color: #2980b9; }')

# Create a deck
leetcode_deck = genanki.Deck(
    2059400110,  # Unique deck ID
    'LeetCode Problems')

# Regular expression to find the problem links
pattern = r'/problems/([^?]+)\?envType=company&amp;envId=(?:facebook|google)&amp;favoriteSlug=(?:facebook-thirty-days|google-six-months)'



