problem_links = re.findall(pattern, html_content)

for slugs in problem_links:
    print(slugs)

# Create notes for each problem
for link in problem_links:
    # Create the full LeetCode URL
    url = f'https://leetcode.com/problems/{link}'
    # Create a nice looking problem name from the slug
    problem_name = link.replace('-', ' ').title()
    
    # Create a note with both the problem name and URL
    note = genanki.Note(
        model=leetcode_model,
        fields=[problem_name, url]  # First field is display text, second is URL
    )
    
    # Add note to deck
    leetcode_deck.add_note(note)

# Generate the Anki package
genanki.Package(leetcode_deck).write_to_file('leetcode_problems.apkg')